import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './nav.css';

const Nav = () => {
  const isLoggedIn = !!localStorage.getItem('student');
  const navigate = useNavigate();

  const logout = () => {
    localStorage.clear();
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <div className="container">
        <Link to="/" className="logo">Your Logo</Link>
        <ul className="nav-menu">
          {isLoggedIn ? (
            <>
              <li><Link to='/home'>Home</Link></li>
              <li><Link to='/allcourses'>All Courses</Link></li>
              <li><Link to='/searchCourse'>Search Course</Link></li>
              <li><Link to='/enrollments'>Enrollments</Link></li>
              <li><Link to='/notes'>Notes</Link></li>
              <li><Link to='/profile'>Profile</Link></li>
              <li><button onClick={logout}>Logout</button></li>
            </>
          ) : (
            <>
              <li><Link to='/login'>Log in</Link></li>
              <li><Link to='/signup'>Sign up</Link></li>
            </>
          )}
        </ul>
      </div>
    </nav>
  );
}

export default Nav;
